/**
 * File: App.js
 * Version: Pre-Production
 * Created by: K. Zimmerman
 * Project: kc_royals_backend
 * Description:
 * - Fixes React Router and ensures `Home.js` reloads properly.
 * - Forces a full reload of `Home.js` and `PlayerProvider` when updated.
 */

import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Navbar from "./components/Navbar";
import { AuthProvider } from "./context/AuthContext";
import { PlayerProvider } from "./context/PlayerContext";
import Home from "./pages/Home";

function App() {
  return (
    <AuthProvider>
      <PlayerProvider key={Date.now()}>
        <Router>
          <Navbar />
          <main className="container mt-3">
            <Routes>
              <Route path="/" element={<Home key={Date.now()} />} />
              <Route path="*" element={<Navigate to="/" />} />
            </Routes>
          </main>
        </Router>
      </PlayerProvider>
    </AuthProvider>
  );
}

export default App;
